def solve():
    s = "t0 t4 t5 t4 t5"

    def generate(grammar, string):
        if string == "":
            return True

        if string == "":
            return False

        for i in range(1, len(string) + 1):
            prefix = string[:i]

            if prefix == "":
                continue

            if grammar.search(prefix):
                if generate(grammar, string[i:]):
                    return True
                else:
                    return False

        return False

    if generate(grammar, s):
        print("Yes")
    else:
        print("No")

