    def is_valid(grammar, string):
        """
        Checks if a string is valid according to the given grammar.
        """
        stack = []
        for char in string:
            if char in grammar.keys():
                stack.append(char)
            elif char in grammar.values():
                if not stack:
                    return False
                top = stack.pop()
                if grammar[top] != string:
                    return False
